 The abstract factory pattern and factory method pattern are both design patterns used in object-oriented programming to create objects. However, they differ in their approach and usage.

The factory method pattern is a creational pattern that defines an interface for creating objects, but allows subclasses to decide which class to instantiate. It provides a default implementation for creating objects, but allows subclasses to override it to create different objects.

The abstract factory pattern is also a creational pattern, but it is more generic than the factory method pattern. It defines an interface for creating families of related or dependent objects without specifying their concrete classes. It allows the client code to be unaware of the actual implementation of the objects being created.

In other words, the factory method pattern is a variant of the abstract factory pattern that only creates objects of a single class. The abstract factory pattern is more flexible, as it can create objects of multiple classes that share a common interface.

Here's an example of the factory method pattern:
```csharp
public interface IMachine {
    void On();
    void Off();
}

public class Light : IMachine {
    public void On() {
        Console.WriteLine("Light is on");
    }

    public void Off() {
        Console.WriteLine("Light is off");
    }
}

public class Speaker : IMachine {
    public void On() {
        Console.WriteLine("Speaker is on");
    }

    public void Off() {
        Console.WriteLine("Speaker is off");
    }
}

public abstract class FactoryMethod {
    public static IMachine CreateMachine() {
        return new Light();
    }
}

public class Example {
    public static void Main() {
        IMachine machine = FactoryMethod.CreateMachine();
        machine.On();
        machine.Off();
    }
}
```
